import { Link } from "react-router-dom";
const DUMMY_EVENTS = [
    {
        id: 'e1',
        title: 'Some event'
    },
    {
        id: 'e2',
        title: 'Another event'
    },

]

function EventPage() {
    return (
        <>
            <h1>EventsPage</h1>
            <ul>
                {DUMMY_EVENTS.map(event => (
                    <li key={event.id}>
                        <Link ></Link>
                    </li>
                ))}
            </ul>
        </>
    )
}

export default EventPage;
